<?php

namespace leet_code;

class Exercicio1926
{
    /**
     * @param String[][] $maze
     * @param Integer[] $entrance
     * @return Integer
     */
    function nearestExit($maze, $entrance)
    {
        $queue = new \SplQueue();
        $queue->enqueue([
            ...$entrance,
            ...[0]
        ]);
        $directions = [
            [1, 0],
            [-1, 0],
            [0, 1],
            [0, -1],
        ];

        $rows = count($maze);
        $cols = count($maze[0]);

        $visited = [];

        while(!$queue->isEmpty()) {
            $node = $queue->dequeue();
            $steps = $node[2];
            $x = $node[0];
            $y = $node[1];

            if (
                ($x == 0 || $x == $rows - 1 || $y == 0 || $y == $cols - 1) &&
                !($entrance[0] == $x && $entrance[1] == $y)
            ) {
                return $steps;
            }

            if ($visited[$x][$y] ?? null) {
                continue;
            }

            $visited[$x][$y] = 1;

            foreach ($directions as $direction) {
                $xAdj = $x + $direction[0];
                $yAdj = $y + $direction[1];

                if (!($xAdj >= 0 && $xAdj < $rows && $yAdj >= 0 && $yAdj < $cols)) {
                    continue;
                }

                $adjacent = $maze[$xAdj][$yAdj];

                if ($adjacent == '.' && !($visited[$xAdj][$yAdj] ?? null)) {
                    $queue->enqueue([$xAdj, $yAdj, $steps + 1]);
                }
            }
        }

        return -1;
    }
}

